                        "Desc": "원소전투 스킬 <color style='color:#FFD780;'>아득한 조석</color> 발동 후, 콜롬비나가 <color style='color:#FFD780;'>인력 파동</color>을 소환한다.<br>인력 파동은 현재 필드 위 캐릭터를 따라다니며, 주변의 적에게 지속적으로 <color style='color:#80C0FF;'>물 원소 범위 피해</color>를 준다.<br><br>또한, 인력 파동이 존재하는 동안 주변에 있는 파티 내 캐릭터가 달빛 반응을 발동하거나 달빛 반응 피해를 줄 시, 콜롬비나는 이후 2초 동안 신월 계시 효과를 얻어 <color style='color:#FFD780;'>인력</color>을 지속적으로 축적한다. 2초마다 인력을 20pt 축적할 수 있다.<br>인력은 최대 60pt까지 축적 가능하며, 인력 파동의 지속 시간이 종료되면 사라진다.<br>인력이 최대치에 도달 시, 특수한 <color style='color:#FFD780;'>인력 간섭</color>을 발동해 콜롬비나가 가장 많은 인력을 축적한 달빛 반응 타입에 따라 서로 다른 효과가 발생한다. 콜롬비나가 가장 많은 인력을 축적한 달빛 반응 타입이:<br> · <color style='color:#FFD780;'>달 감전 반응</color>일 경우: 인력 간섭으로 <color style='color:#FFACFF;'>번개 원소 범위 피해</color>를 1회 준다. 해당 피해는 달 감전 반응 피해로 간주한다.<br> · <color style='color:#FFD780;'>달 개화 반응</color>일 경우: 인력 간섭으로 주변의 적들에게 달 이슬 인장을 5개 발사해 <color style='color:#99FF88;'>풀 원소 피해</color>를 준다. 해당 피해는 달 개화 반응 피해로 간주한다.<br> · <color style='color:#FFD780;'>달 결정 반응</color>일 경우: 인력 간섭으로 <color style='color:#FFE699;'>바위 원소 범위 피해</color>를 1회 준다. 해당 피해는 달 결정 반응 피해로 간주한다"
